import React from 'react'
import JsonData from './data.json'

function JsonDataDisplay(){
    const DisplayData=JsonData.map(
        (info)=>{
            return(
                <tr>
                    <td>{info.id}</td>
                    <td>{info.name}</td>
                    <td>{info.city}</td>
                    <td>{info.img}</td>
                    <td>{info.title}</td>
                    <td>{info.button}</td>
                </tr>
            )
        }
    )

    return(
        <div>
            <h3>Characters</h3>
            <table>
                <thead>
                <tr>
                    <th>Sr.No</th>
                    <th>Name</th>
                    <th>City</th>
                </tr>
                </thead>
                <tbody>
                    {DisplayData}
                </tbody>
            </table>
        </div>
    )
}

export default JsonDataDisplay;
